import React, { useState } from "react";
import Navbar from "./Components/Navbar";
import Home from "./Pages/Home";
import Community from "./Pages/Community";
import FindRoute from "./Pages/FindRoute";
import Profile from "./Components/UserProfile";
import Settings from "./Pages/Settings";
import StationInfo from "./Pages/StationInfo";
import LandingPage from "./Pages/LandingPage";
import ThreadList from "./Components/ThreadList";
import AuthModal from "./Components/AuthModal";
import { AuthProvider } from "./context/AuthContext";
import { UserProvider } from "./context/UserContext";

import "./App.css";
import { Routes, Route, useNavigate } from "react-router-dom";

function App() {
  const [user, setUser] = useState(null);
  const navigate = useNavigate();

  return (
    <div className="App">
      <AuthProvider>
        <UserProvider value={{ user, setUser }}>
          <Navbar />
          <Routes>
            <Route path="/" element={<LandingPage />} />
            <Route path="/home" element={user ? <Home /> : <LandingPage />} />
            <Route path="/community" element={user ? <Community /> : <LandingPage />} />
            <Route path="/find-route" element={user ? <FindRoute /> : <LandingPage />} />
            <Route path="/profile" element={user ? <Profile /> : <LandingPage />} />
            <Route path="/settings" element={user ? <Settings /> : <LandingPage />} />
            <Route path="/station-info" element={user ? <StationInfo /> : <LandingPage />} />
            <Route path="/threads" element={user ? <ThreadList /> : <LandingPage />} />
          </Routes>
          <AuthModal />
        </UserProvider>
      </AuthProvider>
    </div>
  );
}

export default App;
